import "../Footer/footer.css";
import { Link } from "react-router-dom";
import {MailIcon, InstagramIcon, PhoneIcon, FacebookIcon} from '@mui/icons-material/Mail';

const Footer = () => {
    return (
        <footer>
            <div class="footer__contact">
                <Link to={"mailto:comodecirtelojoyas@gmail.com"} target="_blank" rel="noreferrer"><MailIcon className="icon__contact"/></Link>
                <p>comodecirtelojoyas@gmail.com</p>
            </div>
            <div class="footer__contact">
                <Link to={"https://api.whatsapp.com/send?phone=0123456789&text=Hola, Nececito mas informacion sobre"} target="_blank" rel="noreferrer"><PhoneIcon className="icon__contact"/></Link>
                <p>221.613.0884</p>
            </div>
            <div class="footer__contact">
                <div class="social__media">
                    <Link to={"https://www.instagram.com/comodecirtelojoyas/"} target="_blank" rel="noreferrer"><InstagramIcon className="icon__contact"/></Link><Link to={"https://www.instagram.com/comodecirtelojoyas/"} target="_blank"><FacebookIcon className="icon__contact"/></Link>
                </div>
                <p>@comodecirtelojoyas</p>
            </div>
        </footer>
);
}

export default Footer
